import React from 'react'
import { Swiper, SwiperSlide } from "swiper/react";
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

function Brandsworked() {
    return (
        <section>
            <div className="container">
                <div className="brand-work text-center">
                    <h4>Brands I have worked with</h4>
                </div>
                <div className="brand-slides text-white">
                <Swiper
                        spaceBetween={10}
                        slidesPerView={5}
                        freeMode={true}
                        breakpoints={{
                          320: {
                            slidesPerView: 1
                          },
                          576: {
                            slidesPerView: 2
                          },
                          992: {
                            slidesPerView: 3
                          },
                          1200: {
                            slidesPerView: 4
                          }
                        }}
                        
                        onSlideChange={() => console.log("slide change")}
                        onSwiper={(swiper) => console.log(swiper)}
                        className="main_slider33"
                      >
                        <SwiperSlide>
                            <div className="patch-bname">
                                
                            </div>
                        </SwiperSlide>
                        <SwiperSlide>INFRA</SwiperSlide>
                        <SwiperSlide>JENNIS CATERING</SwiperSlide>
                        <SwiperSlide>WHITE SHADOW ACADEMY</SwiperSlide>
                      </Swiper>
                </div>

            </div>
        </section>
    )
}

export default Brandsworked
